import "./App.css"
import Axios from "axios";
import { useEffect, useState } from "react";
import GoogleFonts from 'google-fonts';

const fontURL = 'https://fonts.googleapis.com/css2?family=Roboto+Mono:wght@100;400&display=swap';

//GoogleFonts.load(fontURL);

function App() {
    const [ catFact, setCatFact ] = useState("");

    const fetchCatFact = () => {
        Axios.get("https://catfact.ninja/fact").then((res) => {
            setCatFact(res.data.fact);
        });
    }


    useEffect(() => {
        Axios.get("https://catfact.ninja/fact").then((res) => {
            setCatFact(res.data.fact);
        });
    }, []);



    return (
        <div className="App">
            <button onClick={fetchCatFact}> Generate Cat Fact </button>
            <p style={{fontFamily: 'Roboto Mono'}}>{catFact}</p>
        </div>
    )
}


export default App;
